import React from 'react';
import logo from './logo.svg';
import './App.css';

function Hero() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Alex Graham IT Contractor and Website Builder.
        </p>
        <p>
          Scroll Down<br/>
          for more information
        </p>
      </header>
    </div>
  );
}

export default Hero;
